        content:
          '<p><em>This is a demonstration store. You can purchase products like this from <a href="https://www.purefixcycles.com" target="_blank">Pure Fix Cycles</a></em></p><p>The great thing about a single-speed is simplicity, right? Low maintenance, fewer parts, everything’s just plain easier and now there’s a tool to match! The Park Tool Single Speed Spanner features a 15mm socket wrench for wheel bolts, a 15mm open wrench for pedals, a tire lever and, most importantly, a bottle opener! Everything you need to change a flat and pop open a brew in a size that means you’ll never have to leave home without it!</p>\n<div class="textile">\n<h3>Specs</h3>\n<ul>\n<li>Length: 7” – Perfect for take-along jobs, or workshop wrenching</li>\n<li>15mm socket – axle nuts</li>\n<li>15mm open end – pedals</li>\n<li>Smooth, curved spoon tire lever</li>\n<li>Bottle Opener</li>\n</ul>\n</div>',
