        content:
          '<p><em>This is a demonstration store. You can purchase products like this from <a href="https://www.purefixcycles.com" target="_blank">Pure Fix Cycles</a></em></p><h3>Airboy Mini Pump</h3>\n<p class="lead">The original mini-pump from the haus of SKS is back with an even more beautiful design and some innovative new tech! The 2-chamber/2-plunger system makes for super efficient inflation in an extremely compact size. The Airboy is small enough for a jersey pocket, gets tires up to 115 PSI, and has a soft, ergonomic end-piece that lets you pump away without bruising the palm of your hand! Don’t let flats keep you down. Get some air, boy!</p>',
