    body_html:
      '<meta charset="utf-8"><span data-mce-fragment="1">Tool-kit to equip local healthcare providers to provide high quality, safe primary care for all.</span>\n<div data-mce-fragment="1"><br data-mce-fragment="1"></div>\n<div data-mce-fragment="1">Ideas include creating "respite" care for chronically ill people by hiring community health workers to provide counseling, in-home nursing, home-visiting, and transportation to appointments and treatments.</div>\n<div data-mce-fragment="1"><br data-mce-fragment="1"></div>\n<div data-mce-fragment="1">Patient-centered medical homes, having a patient\'s primary care physician as the "gatekeeper" who makes referrals to specialists or interdisciplinary care teams.</div>',
