          '<p><em>This is a demonstration store. You can purchase products like this from <a href="https://www.purefixcycles.com" target="_blank">Pure Fix Cycles</a></em></p><p>Designed specifically for riders, these jeans seamlessly blend on-the-bike performance with the iconic style and durability you expect from Levi\'s. The Commuter 511 Slim Fit Jeans feature water-resistant stretch fabric, 3M reflective cuffs, a U-lock holder on the waistband, and a higher back-rise for coverage, so you\'ll always look good when you arrive and never sweat getting there.</p>\n<div class="textile">\n<h3>Specs</h3>\n<ul>\n<li>Slightly tapered leg</li>\n<li>Higher back rise for coverage</li>\n<li>Reflective 3M Scotchlite tape on cuff</li>\n<li>Water-resistant and dirt-repellent EcoRepel® protective finish</li>\n<li>U-lock storage on waistband</li>\n<li>93% Cotton, 5% Polyester, 2% Elastane - Imported</li>\n<li>Reinforced pockets for durability</li>\n</ul>\n</div>',
