    template_suffix: "",
    body_html:
      '<meta charset="utf-8"><meta charset="utf-8">\n<div data-mce-fragment="1">Shoes &amp; Apparel are going to add an estimated 2.1 to 2.5 percentage points to growth, while recreation, which includes spending on groceries, will add another 0.9 percentage points.</div>\n<div data-mce-fragment="1"><br data-mce-fragment="1"></div>\n<div data-mce-fragment="1">It’s the third time in recent quarters that weakness in the company’s core businesses have been offset by strength in online sales and other businesses, such as international sales.</div>\n<div data-mce-fragment="1"><br data-mce-fragment="1"></div>\n<div data-mce-fragment="1">Lululemon said it now expects full-year revenue to rise in the high teens to low 20s. It previously had forecast a mid-teens percentage increase.</div>\n<div data-mce-fragment="1"><br data-mce-fragment="1"></div>\n<div data-mce-fragment="1">Analysts had forecast growth in the low teens.</div>\n<br>',
